import React from 'react';
import MilkList from './Components/MilkList';
import { BrowserRouter, Route, Routes} from "react-router-dom";



function App() {
  return (
      <div className="App">
        <BrowserRouter>
            <Routes><Route MilkList/></Routes>
        </BrowserRouter>
      </div>
  );
}

export default App;
